import axios from 'axios'

export default async(req, res) => {
    var response = await axios.get(`https://itunes.apple.com/search?term=rock&media=music&entity=album&genreId=21&attribute=ratingIndex`)
    // const json = await response.json();
    res.json(response.data)
}
